import logo from './logo.svg';
import './App.css';
import Navbar from './Navbar';
import Slider from './Slider';
import Productslist from './Productslist';
import Products from './Products';
import {useEffect, useState} from "react";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Slider />
      <Productslist />
      <Products />
    </div>
  );
}

export default App;
